                "value": itemData['Height'].toString() + ' (cm)',
                "units": ''
              };
              Map<String, String> weight = {
                "name": "Weight",
                "value": itemData['Weight'].toString() + ' (kg)',
                "units": ''
              };
              Map<String, String> bmi = {
                "name": "BMI",
