                "value": itemData['GLU'].toString()
              };
              Map<String, String> pro = {
                "name": "PRO",
                "value": itemData['PRO'].toString()
              };
              Map<String, String> vc = {
                "name": "VC",
                "value": itemData['VC'].toString()
              };
              Map<String, String> sg = {
